/*
	!!!!!!!!!!!Кодировка UTF8
	Формат файлов 
		2 файла
			в первом хранятся crc32 (crc32_Stable) слов в верхнем регистре (без Ё)
			во втором хранятся индексы омонемических групп
		Числа запакованы в 4 байта (pack('N',...))
		Используется открытая хеш таблица с шагом 1 и размером в 4999999 записей
		Индекс первого байта равен 4 * ((abs(crc32())+ i)%4999999)  
		Где i=0,1,2,3, ... (используется для разрешения коллизий хеша)
	Вероятность ложноположительного срабатывания (слова нет, но оно найдено) равно 3000000/2^32 (меньше 1/10 доли процента)	
		
*/

	define('_N0',"\0\0\0\0");//pack('N',0)
	function crc32_Stable($str)//в 64 и 32 битных машинах возвращает одинаковый результат
	{
		$crc = crc32($str);
		if($crc & 0x80000000){
			$crc ^= 0xffffffff;
			$crc += 1;
			$crc = -$crc;
		}
		return $crc;
	}	
