	function MorfFindHash($Word)
	{
		if(!is_integer($Word))
		{
			$Word=mb_strtoupper($Word,'utf8');
			$Word=str_replace('Ё','Е',$Word);
			$CS=crc32_Stable($Word);
		}
		else
			$CS=$Word;

		static $fp=NULL;	
		if($fp===NULL)
			$fp=fopen(dirname(__FILE__).'/hmboh_ind.bin','rb');
			
		$Hash=abs($CS)%4999999;
		$Index0=pack('N',$CS);
		fseek($fp, 4*$Hash);
		while(true)
		{
			$res=fread($fp,4);
			if($res===_N0)
				return NULL;
			if($res===$Index0)
				return $Hash;
			
			$Hash++;
			if($Hash===4999999)
			{
				$Hash=0;
				fseek($fp, 0);
			}
		}
	}
